column66:
The principal aim of the Service is to ensure that residents who have been assessed by a Prescriber as requiring equipment to enable them to live independently, or with support as part of a package of care are supplied with equipment in a timely manner which is sensitive to their needs. Equipment provided must be clean, safe and fully functional. The service will address the needs of children from birth to end of life. The service will support the team of therapists across health, social care and education to ensure that all children are given the opportunity to reach their potential in all areas of their life. The service user groups are adults and children with a Prescriber assessed need to support their health or social care.
Initial scope - community equipment service
Potential future scope - 
Dynamic mattresses for nursing homes;
Long term wheelchairs;
Continence products;
Home Improvement Agency; and
Technology Enabled Care
